window.addEventListener('DOMContentLoaded', (event) => {
    var loadDataButton = document.getElementById('loadData');
    if(loadDataButton) {
        loadDataButton.addEventListener('click', async function() {
            var tabledata = await get_local_json();
            table.setData(tabledata);
            table.redraw();
        });
    } else {
        console.error("Element with id 'loadData' not found");
    }
});

var table = new Tabulator("#example-table", {
    height:205, // set height of table (in CSS or here), this enables the Virtual DOM and improves render speed dramatically (can be any valid css height value)
    data:tabledata, //assign data to table
    layout:"fitData", //fit columns to width of table (optional)
    maxHeight:"100%",
    minHeight:800,
    pagination:"local",
    paginationSize:45,
    movableColumns:true,
    columns:[ //Define Table Columns
    {title:"Name", field:"Job Id", formatter:function(cell, formatterParams, onRendered){
        //cell - the cell component
        //formatterParams - parameters set for the column
        //onRendered - function to call when the formatter has been rendered

        // create elements
        var linkBut = document.createElement("button");

        linkBut.innerHTML = 'click me';

        linkBut.addEventListener("click", function(e){
            console.log("Button was clicked for Job Id: " + cell.getValue());
        });

        return linkBut; //return the contents of the cell;
    }},    
    {title:"Job Id", field:"Job Id"},
    {title:"Customer Name", field:"Customer Name"},
    {title:"Job Name", field:"Job Name"},
    {title:"Last Timesheet Record Date", field:"Last Timesheet Record Date"},
    {title:"Active", field:"Active"},
    {title:"Start Date", field:"Start Date"},
    {title:"End Date", field:"End Date"},
    {title:"Budget Status", field:"Budget Status"},
    {title:"Budget Note", field:"Budget Note"},
    {title:"Job Length (Months)", field:"Job Length (Months)"},
    {title:"Current Project Month", field:"Current Project Month"},
    {title:"Project Timeline % Complete", field:"Project Timeline % Complete"},
    {title:"Total Hours Budgeted", field:"Total Hours Budgeted"},
    {title:"Expected Hours Used To Date", field:"Expected Hours Used To Date"},
    {title:"Total Hours Used To Date", field:"Total Hours Used To Date"},
    {title:"Total Hours Remaining", field:"Total Hours Remaining"},
    {title:"Monthly Budget", field:"Monthly Budget"},
    {title:"Total Hours Used This Month", field:"Total Hours Used This Month"},
    {title:"Total Hours Used Last Month", field:"Total Hours Used Last Month"},

        ,
    ],
});

async function get_local_json() {
    const response = await fetch("data.json");
    const json = await response.json();
    return json;
}

